nq = 100;
omega_ab_interp = zeros(nq,size(omega_ab_cnt64,2));
omega_ms_interp = zeros(nq,size(omega_ms_cnt4,2));
for n = 1:size(omega_ab_cnt64,2)
    q_interp_abinit = linspace(q_cnt4(1),q_cnt4(end),nq);
    omega_ab_interp(:,n) = interp1(q_cnt4,omega_ab_cnt64(:,n), q_interp_abinit, 'spline');
    omega_ms_interp(:,n) = interp1(q_cnt4,omega_ms_cnt4(:,n), q_interp_abinit, 'spline');
end
N = size(omega_ab_interp,1) * size(omega_ab_interp,2);
[DOS_ab_cnt64,E_ab_cnt64] = eig2DOS(omega_ab_interp, N, 10);
[DOS_ms_cnt4,E_ms_cnt4] = eig2DOS(omega_ms_interp, N, 10);
DOS_ab_cnt64(1) = 0; DOS_ms_cnt4(1) = 0;
E_ab_cnt64(1) = 0;E_ms_cnt4(1) = 0;   

hf = figure; hold on; box on;

plot(E_ab_cnt64,DOS_ab_cnt64,'-r', 'linewidth',1);
plot(E_ms_cnt4,DOS_ms_cnt4,'--b', 'linewidth',1);

